import { connect } from 'react-redux'


import Create from '../../page/Set/Class/Create'
import { setSchoolValue, setClassValue } from '../../redux/actions/createClass'
function a(state) {
  // console.log(state);
  return {
    createClass: state.createClass,
    dropDowm: state.dropDowm,
    singleBox:state.singleBox
  }
}
function b(dispatch) {
  return {
    // setSchoolValue: setSchoolValue,
    // setClassValue: setClassValue,
    setSchoolValue:(data)=>{dispatch(setSchoolValue(data))},
    setClassValue:(data)=>{dispatch(setClassValue(data))}
  }
}
export default connect(a, b)(Create)
